  return (
    <div className="App">
      <nav className="navbar navbar-expand-lg navbar- bg-light">
      <ul className="navbar-nav mr-auto">
        <li className="navbar-item active">
        <Link to="/">Beranda</Link>
        </li>
     <li className="navbar "></li>
    <Link to="/hari">hari</Link>
